import React, { Component } from 'react'
import './Location.less';

export default class componentName extends Component {
   
    render() {
       const src="./pic.jpg"
        return (
            <section className="clerk-list">
                {/*   员工信息组件  */}
                <span>项目地址</span>
                 <img href={src} style={{height}}/> 
                <span></span>
            </section>
        )
    }
}
